import React from 'react';
import { useLocation } from 'react-router-dom';

const SearchPage = ({ results }) => {
    return (
        <div>
            <h1>Результаты поиска</h1>
            <ul>
                {results.map((result, index) => (
                    <li key={index}>{result}</li>
                ))}
            </ul>
        </div>
    );
};

export default SearchPage;
